import React, { Component } from 'react';
import { Container, Row, Col } from 'reactstrap';

class Contact extends Component {
  render() {
  return (
    <div class="Contact">
      <Container class="cont">
        <Row>
          <Col>picture 1</Col>
          <Col>picture 2</Col>
          <Col>picture 3</Col>
        </Row>
        <Row>
          <Col>picture 4</Col>
          <Col>picture 5</Col>
          <Col>picture 6</Col>
        </Row>
      </Container>
    </div>
  );
  }
}

export default Contact;
